import React from 'react';
import style from "./assets/css/logoquilt.module.css"

const LogoQuilt = ({urls}) => {
    return (
        <div className="logo-quilt">
            {urls.map(url => (<img src={url} alt={url}></img>))}
        </div>
    )
}

export default LogoQuilt;
